import { BrowserRouter, Route, Switch } from 'react-router-dom';
import './App.css';
import Header from './Header/Header';
import Home from './Home/Home';

function App() {
  return (
    <div className="App">

      <Header />

      <BrowserRouter>

        <Switch>

          <Route exact path="/" component={Home}/>

        </Switch>

      </BrowserRouter>

    </div>
  );
}

export default App;
